.syntax unified
#include "macros.i"

// void polyr_intt(int64_t p[N]) in-place impl
.global raccoon_invntt
.type raccoon_invntt,%function
.align 2
raccoon_invntt:
  //bind aliases
  ptr_p     .req R0
  ptr_zeta  .req R1
  zeta      .req R1
  q         .req R2
  qinv      .req R3
  pol4      .req R4
  pol0      .req R5
  pol1      .req R6
  pol2      .req R7
  pol3      .req R8
  temp_h    .req R9
  temp_l    .req R10
  pol5     .req R11
  pol6     .req R12
  pol7     .req R14

  //preserve registers
  push {R4-R11, R14}
  vpush.w {s16-s23}

  // ****************intt for q1*************** //
  ldr.w qinv, ntt_asm_minus_qinv1
  ldr.w q, ntt_asm_q1
  ldr.w ptr_zeta, =#intt_w1_32_asm

  //stage 1 - 3
  .equ distance, 32
  .equ strincr, 64

  vldm ptr_zeta!, {s2-s8} 
  vmov s0, ptr_zeta

  add.w temp_l, ptr_p, #64*strincr // 64 iterations
  vmov s9, temp_l
  1:
    ldr.w pol4, [ptr_p, #4*distance/4]
    ldr.w pol1, [ptr_p, #5*distance/4]
    ldr.w pol6, [ptr_p, #6*distance/4]
    ldr.w pol3, [ptr_p, #7*distance/4]
    _3_layer_inv_butterfly_light_fast_first pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l
    
    ldr.w pol0, [ptr_p]
    ldr.w pol1, [ptr_p, #1*distance/4]
    ldr.w pol2, [ptr_p, #2*distance/4]
    ldr.w pol3, [ptr_p, #3*distance/4]
    _3_layer_inv_butterfly_light_fast_second pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l
    
    str.w pol1, [ptr_p, #1*distance/4]
    str.w pol2, [ptr_p, #2*distance/4]
    str.w pol3, [ptr_p, #3*distance/4]
    str.w pol4, [ptr_p, #4*distance/4]
    str.w pol5, [ptr_p, #5*distance/4]
    str.w pol6, [ptr_p, #6*distance/4]
    str.w pol7, [ptr_p, #7*distance/4]
    str.w pol0, [ptr_p], #strincr
    vmov temp_l, s9
    cmp.w ptr_p, temp_l
  bne.w 1b
  
  sub ptr_p, #64*strincr

    // stage 4 - 6  
  .equ distance, 256
  .equ strincr, 512

  // iteration 0
  movw temp_l, #8
  add.w temp_l, ptr_p, #8*512 // 8 iterations
  vmov s10, temp_l
	
  vmov ptr_zeta, s0
  vldm ptr_zeta!, {s2-s8}
  vmov s0, ptr_zeta
  2:
    ldr.w pol4, [ptr_p, #4*distance/4]
    ldr.w pol1, [ptr_p, #5*distance/4]
    ldr.w pol6, [ptr_p, #6*distance/4]
    ldr.w pol3, [ptr_p, #7*distance/4]
    _3_layer_inv_butterfly_light_fast_first pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l
    
    ldr.w pol0, [ptr_p]
    ldr.w pol1, [ptr_p, #1*distance/4]
    ldr.w pol2, [ptr_p, #2*distance/4]
    ldr.w pol3, [ptr_p, #3*distance/4]
    _3_layer_inv_butterfly_light_fast_second pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l

    str.w pol1, [ptr_p, #1*distance/4]
    str.w pol2, [ptr_p, #2*distance/4]
    str.w pol3, [ptr_p, #3*distance/4]
    str.w pol4, [ptr_p, #4*distance/4]
    str.w pol5, [ptr_p, #5*distance/4]
    str.w pol6, [ptr_p, #6*distance/4]
    str.w pol7, [ptr_p, #7*distance/4]
    str.w pol0, [ptr_p]
    add.w ptr_p, #strincr

    vmov temp_l, s10
    cmp.w temp_l, ptr_p
  bne.w 2b

  sub.w ptr_p, #8*512-8

  // iteration 1-7
  add.w temp_l, ptr_p, #7*8 // 7 iterations
  vmov s9, temp_l
  1:
    add.w temp_l, ptr_p, #8*strincr // 8 iterations
    vmov s10, temp_l

	  vmov ptr_zeta, s0
    vldm ptr_zeta!, {s2-s8}
    vmov s0, ptr_zeta
    2:     
	    ldr.w pol0, [ptr_p]
	    ldr.w pol1, [ptr_p, #1*distance/4]
	    ldr.w pol2, [ptr_p, #2*distance/4]
	    ldr.w pol3, [ptr_p, #3*distance/4]
	    ldr.w pol4, [ptr_p, #4*distance/4]
	    ldr.w pol5, [ptr_p, #5*distance/4]
	    ldr.w pol6, [ptr_p, #6*distance/4]
	    ldr.w pol7, [ptr_p, #7*distance/4]

	    _3_layer_inv_CT_32 pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l

	    str.w pol1, [ptr_p, #1*distance/4]
	    str.w pol2, [ptr_p, #2*distance/4]
	    str.w pol3, [ptr_p, #3*distance/4]
	    str.w pol4, [ptr_p, #4*distance/4]
	    str.w pol5, [ptr_p, #5*distance/4]
	    str.w pol6, [ptr_p, #6*distance/4]
	    str.w pol7, [ptr_p, #7*distance/4]
	    str.w pol0, [ptr_p]
      add.w ptr_p, #strincr

      vmov temp_l, s10
      cmp.w ptr_p, temp_l
    bne 2b
    sub.w ptr_p, #8*strincr-8

    vmov temp_l, s9
    cmp.w temp_l, ptr_p
  bne 1b
  
  sub ptr_p, #8*8
  vmov ptr_zeta, s0

  //stage 7, 8, 9
  .equ distance, 2048
  .equ strincr, 8
  add.w temp_l, ptr_p, #64*strincr // 64 iterations
  vmov s9, temp_l
  // stage 7-9
  4:
    vmov ptr_zeta, s0
    vldm ptr_zeta!, {s2-s8}
    vldm ptr_zeta!, {s11-s18}
    vmov s0, ptr_zeta
    ldr.w pol0, [ptr_p]
    ldr.w pol1, [ptr_p, #1*distance/4]
    ldr.w pol2, [ptr_p, #2*distance/4]
    ldr.w pol3, [ptr_p, #3*distance/4]
    ldr.w pol4, [ptr_p, #4*distance/4]
    ldr.w pol5, [ptr_p, #5*distance/4]
    ldr.w pol6, [ptr_p, #6*distance/4]
    ldr.w pol7, [ptr_p, #7*distance/4]

    _3_layer_inv_CT_32 pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l
    
    _3_layer_inv_twist_CT_32 pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s11, s12, s13, s14, s15, s16, s17, s18, zeta, qinv, q, temp_h, temp_l

    mont32_cadd_asm pol0, q, temp_l
    mont32_cadd_asm pol1, q, temp_l
    mont32_cadd_asm pol2, q, temp_l
    mont32_cadd_asm pol3, q, temp_l
    mont32_cadd_asm pol4, q, temp_l
    mont32_cadd_asm pol5, q, temp_l
    mont32_cadd_asm pol6, q, temp_l
    mont32_cadd_asm pol7, q, temp_l
    
    str.w pol1, [ptr_p, #1*distance/4]
    str.w pol2, [ptr_p, #2*distance/4]
    str.w pol3, [ptr_p, #3*distance/4]
    str.w pol4, [ptr_p, #4*distance/4]
    str.w pol5, [ptr_p, #5*distance/4]
    str.w pol6, [ptr_p, #6*distance/4]
    str.w pol7, [ptr_p, #7*distance/4]
    str.w pol0, [ptr_p], #strincr

    vmov temp_l, s9
    cmp.w temp_l, ptr_p
  bne.w 4b


  // ****************intt for q2*************** //
  sub ptr_p, #64*strincr-4
  
  ldr.w qinv, ntt_asm_minus_qinv2
  ldr.w q, ntt_asm_q2
  ldr.w ptr_zeta, =#intt_w2_32_asm

  //stage 1 - 3
  .equ distance, 32
  .equ strincr, 64

  vldm ptr_zeta!, {s2-s8} 
  vmov s0, ptr_zeta

  add.w temp_l, ptr_p, #64*strincr // 64 iterations
  vmov s9, temp_l
  1:
    ldr.w pol4, [ptr_p, #4*distance/4]
    ldr.w pol1, [ptr_p, #5*distance/4]
    ldr.w pol6, [ptr_p, #6*distance/4]
    ldr.w pol3, [ptr_p, #7*distance/4]
    _3_layer_inv_butterfly_light_fast_first pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l
    
    ldr.w pol0, [ptr_p]
    ldr.w pol1, [ptr_p, #1*distance/4]
    ldr.w pol2, [ptr_p, #2*distance/4]
    ldr.w pol3, [ptr_p, #3*distance/4]
    _3_layer_inv_butterfly_light_fast_second pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l
    
    str.w pol1, [ptr_p, #1*distance/4]
    str.w pol2, [ptr_p, #2*distance/4]
    str.w pol3, [ptr_p, #3*distance/4]
    str.w pol4, [ptr_p, #4*distance/4]
    str.w pol5, [ptr_p, #5*distance/4]
    str.w pol6, [ptr_p, #6*distance/4]
    str.w pol7, [ptr_p, #7*distance/4]
    str.w pol0, [ptr_p], #strincr
    vmov temp_l, s9
    cmp.w ptr_p, temp_l
  bne.w 1b
  
  sub ptr_p, #64*strincr

    // stage 4 - 6  
  .equ distance, 256
  .equ strincr, 512

  // iteration 0
  movw temp_l, #8
  add.w temp_l, ptr_p, #8*512 // 8 iterations
  vmov s10, temp_l
	
  vmov ptr_zeta, s0
  vldm ptr_zeta!, {s2-s8}
  vmov s0, ptr_zeta
  2:
    ldr.w pol4, [ptr_p, #4*distance/4]
    ldr.w pol1, [ptr_p, #5*distance/4]
    ldr.w pol6, [ptr_p, #6*distance/4]
    ldr.w pol3, [ptr_p, #7*distance/4]
    _3_layer_inv_butterfly_light_fast_first pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l
    
    ldr.w pol0, [ptr_p]
    ldr.w pol1, [ptr_p, #1*distance/4]
    ldr.w pol2, [ptr_p, #2*distance/4]
    ldr.w pol3, [ptr_p, #3*distance/4]
    _3_layer_inv_butterfly_light_fast_second pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l

    str.w pol1, [ptr_p, #1*distance/4]
    str.w pol2, [ptr_p, #2*distance/4]
    str.w pol3, [ptr_p, #3*distance/4]
    str.w pol4, [ptr_p, #4*distance/4]
    str.w pol5, [ptr_p, #5*distance/4]
    str.w pol6, [ptr_p, #6*distance/4]
    str.w pol7, [ptr_p, #7*distance/4]
    str.w pol0, [ptr_p]
    add.w ptr_p, #strincr

    vmov temp_l, s10
    cmp.w temp_l, ptr_p
  bne.w 2b

  sub.w ptr_p, #8*512-8

  // iteration 1-7
  add.w temp_l, ptr_p, #7*8 // 7 iterations
  vmov s9, temp_l
  1:
    add.w temp_l, ptr_p, #8*strincr // 8 iterations
    vmov s10, temp_l

	  vmov ptr_zeta, s0
    vldm ptr_zeta!, {s2-s8}
    vmov s0, ptr_zeta
    2:     
	    ldr.w pol0, [ptr_p]
	    ldr.w pol1, [ptr_p, #1*distance/4]
	    ldr.w pol2, [ptr_p, #2*distance/4]
	    ldr.w pol3, [ptr_p, #3*distance/4]
	    ldr.w pol4, [ptr_p, #4*distance/4]
	    ldr.w pol5, [ptr_p, #5*distance/4]
	    ldr.w pol6, [ptr_p, #6*distance/4]
	    ldr.w pol7, [ptr_p, #7*distance/4]

	    _3_layer_inv_CT_32 pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l

	    str.w pol1, [ptr_p, #1*distance/4]
	    str.w pol2, [ptr_p, #2*distance/4]
	    str.w pol3, [ptr_p, #3*distance/4]
	    str.w pol4, [ptr_p, #4*distance/4]
	    str.w pol5, [ptr_p, #5*distance/4]
	    str.w pol6, [ptr_p, #6*distance/4]
	    str.w pol7, [ptr_p, #7*distance/4]
	    str.w pol0, [ptr_p]
      add.w ptr_p, #strincr

      vmov temp_l, s10
      cmp.w ptr_p, temp_l
    bne 2b
    sub.w ptr_p, #8*strincr-8

    vmov temp_l, s9
    cmp.w temp_l, ptr_p
  bne 1b
  
  sub ptr_p, #8*8
  vmov ptr_zeta, s0

  //stage 7, 8, 9
  .equ distance, 2048
  .equ strincr, 8
  add.w temp_l, ptr_p, #64*strincr // 64 iterations
  vmov s9, temp_l
  // stage 7-9
  4:
    vmov ptr_zeta, s0
    vldm ptr_zeta!, {s2-s8}
    vldm ptr_zeta!, {s11-s18}
    vmov s0, ptr_zeta
    ldr.w pol0, [ptr_p]
    ldr.w pol1, [ptr_p, #1*distance/4]
    ldr.w pol2, [ptr_p, #2*distance/4]
    ldr.w pol3, [ptr_p, #3*distance/4]
    ldr.w pol4, [ptr_p, #4*distance/4]
    ldr.w pol5, [ptr_p, #5*distance/4]
    ldr.w pol6, [ptr_p, #6*distance/4]
    ldr.w pol7, [ptr_p, #7*distance/4]

    _3_layer_inv_CT_32 pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s2, s3, s4, s5, s6, s7, s8, zeta, qinv, q, temp_h, temp_l
    
    _3_layer_inv_twist_CT_32 pol0, pol1, pol2, pol3, pol4, pol5, pol6, pol7, s11, s12, s13, s14, s15, s16, s17, s18, zeta, qinv, q, temp_h, temp_l

    mont32_cadd_asm pol0, q, temp_l
    mont32_cadd_asm pol1, q, temp_l
    mont32_cadd_asm pol2, q, temp_l
    mont32_cadd_asm pol3, q, temp_l
    mont32_cadd_asm pol4, q, temp_l
    mont32_cadd_asm pol5, q, temp_l
    mont32_cadd_asm pol6, q, temp_l
    mont32_cadd_asm pol7, q, temp_l
    
    str.w pol1, [ptr_p, #1*distance/4]
    str.w pol2, [ptr_p, #2*distance/4]
    str.w pol3, [ptr_p, #3*distance/4]
    str.w pol4, [ptr_p, #4*distance/4]
    str.w pol5, [ptr_p, #5*distance/4]
    str.w pol6, [ptr_p, #6*distance/4]
    str.w pol7, [ptr_p, #7*distance/4]
    str.w pol0, [ptr_p], #strincr

    vmov temp_l, s9
    cmp.w temp_l, ptr_p
  bne.w 4b

  sub ptr_p, #64*strincr+4

  // ****************** poly_join and normalize **************** //
  // qinv: q1; q:q2
  ldr qinv, #ntt_asm_q1
  smull pol6, pol7, q, qinv // q1*q2

  add.w zeta, ptr_p, #4096
  1:
    ldr.w pol0, [ptr_p]
    ldr.w pol1, [ptr_p, #4*1]
    ldr.w pol2, [ptr_p, #4*2]
    ldr.w pol3, [ptr_p, #4*3]

    smull pol0, pol4, pol0, q
    smlal pol0, pol4, pol1, qinv
    smull pol2, pol5, pol2, q
    smlal pol2, pol5, pol3, qinv
    mont64_csub_asm pol0, pol4, pol6, pol7, temp_l, temp_h
    mont64_csub_asm pol2, pol5, pol6, pol7, temp_l, temp_h

    str.w pol4, [ptr_p, #4*1]
    str.w pol2, [ptr_p, #4*2]
    str.w pol5, [ptr_p, #4*3]
    str.w pol0, [ptr_p], #4*4
  cmp.w ptr_p, zeta
  bne 1b
  
  //restore registers
  vpop.w {s16-s23}
  pop {R4-R11, PC}


.ltorg


